input = """



"""

words = input.split('\n')
current = 5
code = []

for word in words:
    for letter in word:
        if letter == 'U' and current not in [1,2,3]:
            current -= 3
        elif letter == 'D' and current not in [7,8,9]:
            current += 3
        elif letter == 'R' and current not in [3,6,9]:
            current += 1
        elif letter == 'L' and current not in [1,4,7]:
            current -= 1
    code.append(current)
print(code)
